import { Component } from '@angular/core';

@Component({
  selector: 'app-breeds-list',
  templateUrl: './breeds-list.component.html',
  styleUrls: ['./breeds-list.component.scss']
})
export class BreedsListComponent {
  const breeds = [
    { name: "Affenpinscher", image: "https://images.dog.ceo/breeds/affenpinscher/n02110627_10047.jpg" },
    { name: "Afghan Hound", image: "https://images.dog.ceo/breeds/hound-afghan/n02088094_1003.jpg" },
    { name: "Airedale Terrier", image: "https://images.dog.ceo/breeds/airedale/n02096051_1003.jpg" },
    { name: "Akita", image: "https://images.dog.ceo/breeds/akita/512px-Ainu_Dog.jpg" },
    { name: "Alaskan Malamute", image: "https://images.dog.ceo/breeds/malamute/n02110063_10026.jpg" },
  ]
}
